import React from 'react'
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faGithub, faLinkedin, faMailchimp} from '@fortawesome/free-brands-svg-icons';


export default function Footer() {
  return (
    <div  style={{backgroundColor:"black"}}><div className="card bg-light text-center">
    <div className="card-header " style={{backgroundColor:"rgb(153, 245, 214)"}}>
      <h4 style={{backgroundColor:"rgb(153, 245, 214)",color:"white"}}>Contact</h4> 
    </div>
    <div className="card-body "  >
      
    
      <a href="https://www.linkedin.com/in/suryansh-pandey-031223252/" className="btn mt-2" style={{ color: 'white' }} ><FontAwesomeIcon icon={faLinkedin} beatFade /> Linkedin </a><br/>
       
      <span style={{ color: 'white' }} > ||</span> <br/>
      <a href="https://github.com/suryansh6393" className="btn mt-2" style={{ color: 'white' }} ><FontAwesomeIcon icon={faGithub} beatFade /> Github </a><br/>
       
    </div>
  </div></div>
  )
}
